<script>
  assert(jQuery.isWindow(window), "window");
  assert(jQuery.isWindow(document.getElementsByTagName("iframe")[0].contentWindow), "iframe.contentWindow");
  assert(!(jQuery.isWindow()), "empty");
  assert(!(jQuery.isWindow(null)), "null");
  assert(!(jQuery.isWindow(undefined)), "undefined");
  assert(!(jQuery.isWindow(document)), "document");
  assert(!(jQuery.isWindow(document.documentElement)), "documentElement");
  assert(!(jQuery.isWindow("")), "string");
  assert(!(jQuery.isWindow(1)), "number");
  assert(!(jQuery.isWindow(true)), "boolean");
  assert(!(jQuery.isWindow({})), "object");
  assert(!(jQuery.isWindow({})), "fake window");
  assert(!(jQuery.isWindow(/window/)), "regexp");
  assert(!(jQuery.isWindow(function(){})), "function");
